window.bookSummaryJSON = "<p><b>Our love has become poison, and it's killing us slowly. </b></p> <p>I hate how I can't control myself around him. I hate how I always forgive him. I hate that he consumes me. Because, Alexander is in my blood. His heart beats in my chest. He owns me.</p> <p>But I can't see past his betrayal and his lies. Not this time. I don't know if our love can survive this because I'm not the girl that fell in love with him, anymore. I'm a queen, and everyone, even him, will bow to me.</p> <p>Every family has its secrets. The Royals more than most. This seductive book in the Royal World series is hotter, darker, and wilder than ever. You think you know this story? Think again.</p>"; 
